import React, { useState } from "react";
import { Link } from "react-router-dom";
import "../styles/Home.css";

// Sample project images
import project1Image from "../assets/project1.jpg";
import project2Image from "../assets/project2.jpg";
import project3Image from "../assets/project3.jpg";

function Home() {
  const [like1, setLike1] = useState(0);
  const [liked1, setLiked1] = useState(false);
  
  const [like2, setLike2] = useState(0);
  const [liked2, setLiked2] = useState(false);
  
  const [like3, setLike3] = useState(0);
  const [liked3, setLiked3] = useState(false);

  const toggleLike1 = () => {
    setLike1(liked1 ? like1 - 1 : like1 + 1);
    setLiked1(!liked1);
  };

  const toggleLike2 = () => {
    setLike2(liked2 ? like2 - 1 : like2 + 1);
    setLiked2(!liked2);
  };

  const toggleLike3 = () => {
    setLike3(liked3 ? like3 - 1 : like3 + 1);
    setLiked3(!liked3);
  };

  return (
    <div className="container">
      <h1 style={{ textAlign: "center" }}>MY PROJECTS</h1>
      <div className="row">
        <div className="col-md-4">
          <div className="card post-card">
            <div className="card-header">
              <h5 className="card-title">Callback Task</h5>
            </div>
            <img src={project1Image} alt="Project 1" className="card-img-top" />
            <div className="card-body">
              <button
                onClick={toggleLike1}
                className="like-button"
              >
                {liked1 ? "‚ù§Ô∏è" : "üëç"} <span>{like1 ? like1 : ""}</span>
              </button>
            </div>
            <div className="card-footer">
              <Link to="/calling" className="btn btn-primary">
                View Project
              </Link>
            </div>
          </div>
        </div>
        
        <div className="col-md-4">
          <div className="card post-card">
            <div className="card-header">
              <h5 className="card-title">Table Generation</h5>
            </div>
            <img src={project2Image} alt="Project 2" className="card-img-top" />
            <div className="card-body">
              <button
                onClick={toggleLike2}
                className="like-button"
              >
                {liked2 ? "‚ù§Ô∏è" : "üëç"} <span>{like2 ? like2 : ""}</span>
              </button>
            </div>
            <div className="card-footer">
              <Link to="/Table" className="btn btn-primary">
                View Project
              </Link>
            </div>
          </div>
        </div>
        
        <div className="col-md-4">
          <div className="card post-card">
            <div className="card-header">
              <h5 className="card-title">Redux</h5>
            </div>
            <img src={project3Image} alt="Project 3" className="card-img-top" />
            <div className="card-body">
              <button
                onClick={toggleLike3}
                className="like-button"
              >
                {liked3 ? "‚ù§Ô∏è" : "üëç"} <span>{like3 ? like3 : ""}</span>
              </button>
            </div>
            <div className="card-footer">
              <Link to="/counter-redux" className="btn btn-primary">
                View Project
              </Link>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
